import{_ as a,e as n,o as s,c as r,a as e,f as p,b as t,d as c}from"./app.3398e39f.js";var d="/assets/blogImg/aj.jpg";const i={},_=e("h2",{id:"date-2016-01-04-21-30",tabindex:"-1"},[e("a",{class:"header-anchor",href:"#date-2016-01-04-21-30","aria-hidden":"true"},"#"),t(" date: 2016-01-04 21:30")],-1),h=e("p",null,[e("img",{src:d,alt:""})],-1),l={id:"picture-by-anna-paschenko-for-doubble",tabindex:"-1"},f=e("a",{class:"header-anchor",href:"#picture-by-anna-paschenko-for-doubble","aria-hidden":"true"},"#",-1),b=t(" Picture by "),u={href:"https://dribbble.com/shots/1188443-Sea",target:"_blank",rel:"noopener noreferrer"},g=t("Anna Paschenko"),m=t(" for Doubble"),A=c("<p>\u201C\u65E0\u4EBA\u4E3A\u5B64\u5C9B\uFF0C\u4E00\u4E66\u4E00\u4E16\u754C\u201D\u3002 \u5C0F\u5C9B\u4E66\u5E97\u7684\u892A\u8272\u62DB\u724C\u4E0A\uFF0C\u5199\u7740\u8FD9\u4E48\u4E00\u53E5\u8BDD\u3002 \u663E\u7136\uFF0C\u4ECE\u4E00\u5F00\u59CB\uFF0C\u8FD9\u5C31\u662F\u4E00\u53E5\u5047\u8BDD\u3002</p><p><strong>\u5B64\u72EC\u96BE\u4EE5\u63CF\u8FF0\uFF0C\u504F\u504F\u4EBA\u4EEC\u559C\u6B22\u5199</strong>\u3002 \u9A6C\u5C14\u514B\u65AF\u7684\u8352\u8BDE\u6DF1\u9083\uFF0C\u4E1C\u91CE\u572D\u543E\u628A\u7EDD\u671B\u5199\u8FDB\u4E86\u9AA8\u9AD3\u91CC\uFF0C\u963F\u591A\u5C3C\u65AF\u5374\u8BF4\u90A3\u662F\u4ED6\u7684\u4E00\u5EA7\u82B1\u56ED\u3002\u800C\u5728\u300A\u5C9B\u4E0A\u4E66\u5E97\u300B\u91CC\uFF0C\u5B64\u72EC\u662F\u6E29\u6696\u7684\u3002\u8FD9\u5C31\u5F88\u5C11\u89C1\u3002</p><p>\u770B\u5B8C\u4E66\u65F6\u6B63\u5DE7\u5728\u98DE\u673A\u4E0A\uFF0C\u5E95\u4E0B\u5E94\u8BE5\u662F\u6D77\uFF0C\u4E91\u5C42\u6F2B\u6F2B\u4EE4\u4EBA\u9050\u60F3\u3002\u4E66\u4E2D\u827E\u8389\u4E1D\u5C9B\u7684\u6A21\u6837\u4F9D\u7136\u6A21\u7CCA\uFF0C\u5012\u662F\u4EBA\u7269\u5206\u660E\u3002\u90A3\u95F4\u201C\u5341\u4E94\u4E2A\u739B\u96C5\u5BBD\uFF0C\u4E8C\u5341\u4E2A\u739B\u96C5\u957F\u201D\u7684\u4E66\u5E97\u8D8A\u53D1\u6E05\u6670\u3002\u5B83\u7ECF\u884C\u5149\u5F71\uFF0C\u7A7F\u8D8A\u65F6\u95F4\uFF0C\u4EFF\u4F5B\u5C31\u5728\u773C\u524D\u3002\u6D41\u6C34\u822C\u7684\u7B14\u8C03\uFF0C\u4E0D\u505A\u4F5C\u7684\u5E7D\u9ED8\uFF0C\u6211\u731C\u739B\u96C5\u4F1A\u559C\u6B22\u5B83\u7684\u3002 \u603B\u7684\u6765\u8BF4\uFF0C\u53D9\u4E8B\u65B9\u5F0F\u4E0D\u662F\u6211\u559C\u6B22\u7684\u90A3\u79CD\uFF0C\u4F46\u5C31\u5982\u521A\u624D\u6240\u8BF4\uFF0C\u5B83\u6BD4\u8F83\u7279\u6B8A\u3002\u4EE4\u6211\u603B\u662F\u60F3\u8D77\u4E00\u4E9B\uFF0C\u4EE5\u524D\u7684\u4E8B\u60C5\u2026</p><p>\u53EF\u662F\uFF0C<strong>\u5B64\u72EC\u96BE\u4EE5\u53BB\u5199\uFF0C\u504F\u504F\u4EBA\u4EEC\u603B\u9047\u5230</strong>\u3002</p><p>\u90A3\u65F6\uFF0CA.J.\u4E0E\u5FD7\u8DA3\u76F8\u6295\u7684\u59BB\u5B50\u59AE\u53EF\uFF0C\u653E\u5F03\u4E86\u6587\u5B66\u535A\u58EB\u5B66\u4F4D\uFF0C\u8DD1\u6765\u5B64\u8FDC\u7684\u827E\u8389\u4E1D\u5C9B\uFF0C\u5F00\u4E00\u95F4\u4E66\u5E97\u3002\u4EC5\u4EC5\u56E0\u4E3A\u201C\u4E00\u4E2A\u5730\u65B9\u5982\u679C\u6CA1\u6709\u4E00\u5BB6\u4E66\u5E97\uFF0C\u5C31\u7B97\u4E0D\u4E0A\u4E00\u4E2A\u5730\u65B9\u4E86\u201D\u3002</p><p>\u7136\u800C\uFF0C\u751F\u6D3B\u8BA9 A.J.\u592A\u8FC7\u5931\u671B\u3002 \u631A\u7231\u7684\u59AE\u53EF\u53BB\u4E16\uFF0C\u5FD7\u8DA3\u76F8\u6295\u7684\u56FE\u4E66\u9500\u552E\u5458\u54C8\u7EF4\u4E5F\u957F\u8F9E\uFF0C\u9547\u5E97\u4E4B\u5B9D\u300A\u5E16\u6728\u513F\u300B\u88AB\u76D7\u3002\u4E00\u4EF6\u4EF6\u70E6\u5FC3\u4E8B\u8BA9 A.J.\u8D8A\u53D1\u5B64\u50FB\u51B7\u6F20\uFF0C\u4E0D\u8FD1\u4EBA\u60C5\uFF0C\u6392\u65A5\u4E00\u5207\u3002\u5185\u5FC3\uFF0C\u6E10\u5982\u4E66\u5E97\u6240\u5728\u7684\u5B64\u5C9B\u3002</p><p>\u201C\u6CA1\u6709\u4EBA\u559C\u6B22\u5B64\u72EC\uFF0C\u53EA\u662F\u4E0D\u559C\u6B22\u5931\u671B\u3002\u201D\u6751\u4E0A\u6625\u6811\u8BF4\u3002</p><p>\u547D\u8FD0\u50CF\u5C0F\u5077\uFF0C\u5931\u671B\u7684 A.J.\u5374\u6CA1\u60F3\u8FC7\uFF0C\u8FD9\u4E2A\u5C0F\u5077\u7ADF\u4F1A\u9001\u7ED9\u4ED6\u4EC0\u4E48\u3002 \u739B\u96C5\uFF0C\u4E00\u4E2A\u5F03\u5A74\uFF0C\u51FA\u73B0\u5728\u5C0F\u5C9B\u4E66\u5E97\u4E2D\u3002</p><p>\u72B9\u8C6B\u4E0D\u51B3\u4E2D\uFF0C\u8FD8\u662F\u9009\u62E9\u6536\u517B\u739B\u96C5\u7684 A.J.\uFF0C\u4E0D\u5F97\u4E0D\u4E0E\u8EAB\u8FB9\u7684\u4EBA\u8FDB\u884C\u4EA4\u6D41\u3002</p><p>\u591A\u5E74\u4EE5\u540E\uFF0CA.J.\u60F3\u8BF4\u201C\u7231\u201D\u5374\u8BF4\u4E0D\u51FA\u6765\u7684\u65F6\u5019\uFF0C\u4ED6\u624D\u660E\u767D\uFF0C\u201C\u4E00\u4E66\u4E00\u4E16\u754C\u201D\uFF0C\u9760\u4E66\u53BB\u6392\u89E3\u5B64\u72EC\u7684\u8BF4\u6CD5\uFF0C\u5206\u660E\u662F\u53E5\u5047\u8BDD\u3002 \u4F7F\u4ED6\u4E0D\u518D\u5B64\u72EC\u7684\uFF0C\u6C38\u8FDC\u662F\u8EAB\u8FB9\u7684\u4EBA\u3002</p><p><strong>\u53C8\u7531\u7ED3\u5C40\u540E\u7684\u827E\u7C73\u60F3\u5230\u4E86\u4E09\u6BDB\uFF0C\u7279\u522B\u5728\u4ECA\u5929</strong>\u3002 \u4E8C\u5341\u4E94\u5E74\u524D\u7684\u4ECA\u5929\uFF0C\u4E09\u6BDB\u4E0E\u5979\u7684\u81EA\u7531\uFF0C\u6C38\u8FDC\u7684\u79C1\u5954\u800C\u53BB\u3002</p><p>\u5F97\u77E5\u4E09\u6BDB\u751F\u5E73\u540E\uFF0C\u518D\u770B\u300A\u6492\u54C8\u62C9\u7684\u6545\u4E8B\u300B\u5176\u5B9E\u662F\u53E6\u4E00\u756A\u5929\u5730\uFF0C\u4F60\u770B\u5230\u5979\u7684\u8F66\u5B50\u5728\u6C99\u6F20\u72C2\u5954\u65F6\uFF0C\u603B\u60F3\u5E2E\u5979\u8E29\u4E00\u811A\u5239\u8F66\uFF0C\u56E0\u4E3A\u6628\u65E5\u7684\u6B22\u6B4C\u548C\u660E\u65E5\u7684\u60B2\u4F24\u603B\u6210\u6B63\u6BD4\u3002\u770B\u300A\u4E07\u6C34\u5343\u5C71\u8D70\u904D\u300B\u65F6\u4F9D\u7136\u5FC3\u60CA\uFF0C\u4F60\u5E0C\u671B\u5979\u80FD\u6D41\u9732\u4E9B\u60B2\u4F24\u7684\u60C5\u7EEA\uFF0C\u5408\u9002\u5C31\u597D\uFF0C\u7136\u800C\u5979\u8EAB\u5F71\u5306\u5306\uFF0C\u4EFF\u4F5B\u9762\u65E0\u8868\u60C5\uFF0C\u8D70\u9A6C\u800C\u8FC7\u3002 \u7136\u540E\u4F60\u53EA\u80FD\u542C\u4E4B\u4EFB\u4E4B\uFF0C\u5BF9\u8FD9\u6CE2\u6F9C\u58EE\u9614\u7684\u751F\u547D\u97A0\u4E00\u4E2A\u8EAC\u3002</p><p>\u540E\u6765\u4F60\u5BFB\u5230\u4E00\u4E2A\u89E3\u91CA\u53EB\u201C\u4E07\u7269\u7686\u7A7A\u201D\u3002\u539F\u6765\u5728\u65F6\u95F4\u7684\u4E0D\u540C\u523B\u5EA6\uFF0C\u5B64\u72EC\u90FD\u4E0D\u76F8\u96F7\u540C\uFF0C\u65E0\u8BBA\u63CF\u8FF0\u5B83\u7684\u6587\u5B57\uFF0C\u662F\u6E29\u6696\u7684\uFF0C\u8FD8\u662F\u523B\u8584\u7684\u3002\u5B83\u5C31\u5728\u90A3\u513F\uFF0C\u4E00\u52A8\u4E0D\u52A8\uFF0C\u4EFF\u4F5B\u53C8\u4E0D\u5728\u90A3\u513F\u3002</p><p>\u5C31\u50CF\uFF0CA.J.\u53EA\u80FD\u628A love\uFF0C\u8BF4\u6210 glove\uFF1B \u5C31\u50CF\uFF0C\u739B\u96C5\u53EA\u80FD\u5728\u300A\u6D77\u6EE9\u4E00\u65E5\u300B\u91CC\u56DE\u5FC6\u7740\u4EB2\u751F\u6BCD\u4EB2\uFF1B \u5C31\u50CF\uFF0C\u827E\u7C73\u5230\u6700\u540E\u90FD\u6DF1\u85CF\u7740\u300A\u8FDF\u66AE\u82B1\u5F00\u300B\u7684\u771F\u76F8\uFF1B \u5C31\u50CF\uFF0C\u5170\u6BD4\u4E9A\u65AF\u4E0E\u4F0A\u65AF\u6885\u6700\u540E\u5B88\u62A4\u7740\u7684\u90A3\u5BB6\u5C0F\u5C9B\u4E66\u5E97\u3002</p><p>\u4F60\u8BF4\u8FD9\u662F\u4E00\u672C\u6E29\u6696\u7684\u5C0F\u8BF4\uFF0C\u4F46\u5B83\u7684\u51B7\u9177\u53C8\u6446\u5728\u4F60\u89E6\u624B\u53EF\u53CA\u7684\u5730\u65B9\u3002 \u50CF\u4E00\u5F20\u8584\u8584\u7684\u88AB\u5B50\uFF0C\u4F60\u62E5\u4E4B\u5165\u7720\uFF0C\u800C\u540E\u53C8\u534A\u591C\u51B7\u9192\u3002\u6240\u8C13\u51B7\u6696\u81EA\u77E5\uFF0C\u5927\u62B5\u5982\u6B64\u3002 \u90A3\uFF0C\u65E2\u7136\u4E0D\u53EF\u80FD\u96E8\u5B63\u4E0D\u518D\u6765\uFF0C\u80FD\u505A\u7684\uFF0C\u53EA\u6709\u6BEB\u65E0\u754F\u60E7\uFF0C\u70ED\u70C8\u800C\u5B81\u9759\u5730\u8D70\u904D\u4E07\u6C34\u5343\u5C71\u5427\u3002</p><p>\u201C\u4E00\u4E66\u4E00\u4E16\u754C\uFF0C\u4E00\u5C81\u4E00\u67AF\u8363\uFF1B\u65E0\u4EBA\u4E3A\u5B64\u5C9B\uFF0C\u6625\u98CE\u5439\u53C8\u751F\u201D\u3002 \u53C8\u6216\u8BB8\uFF0C\u90A3\u53E5\u5047\u8BDD\uFF0C\u4ECE\u4E00\u5F00\u59CB\uFF0C\u5C31\u662F\u771F\u7684\u5462\u3002</p><p>\u2014\u2014Litten 2016.1.4</p>",17);function k(x,v){const o=n("ExternalLinkIcon");return s(),r("div",null,[_,h,e("h6",l,[f,b,e("a",u,[g,p(o)]),m]),A])}var j=a(i,[["render",k],["__file","the-storied-life-of-aj.html.vue"]]);export{j as default};
